    false,nt"url": null,nt"notes": "This report summarizes noxious weed control
    on Malheur National Wildlife Refuge in 2010.  There were 4,255.4 acres treated on
    the refuge. The total cost for this treatment was $150,715.71.  This translates
    into $35.42/acre for chemicals and treatment. Ecosystems Management, Inc. tried
    to use combinations of different chemicals to improve control with Perennial Pepperweed.
    They kept a close eye on the use of Hi-Dep. The report also contains summaries of
    weed control on various Refuge Units.  Invoices for weed control treatments are
    also provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
